      out.write("function build_config_list(target, list) {\n");
      out.write("\t$.each(list, function(i, v){\n");
      out.write("\t\tvar c = $(\"#sample_config\").clone(true);\n");
      out.write("\t\tc.removeClass(\"hidden\");\n");
      out.write("\t\tc.find(\"input\").val(\"\");\n");
      out.write("\t\t// shooter or capture 종류 구분\n");
      out.write("\t\tc.find(\"input[name=target]\").val(target);\n");
      out.write("\t\tc.find(\"select[name=enable]\").val(v.enable).change();\n");
      out.write("\t\tc.find(\"input[name=desc]\").val(v.desc);\n");
      out.write("\t\tc.find(\"input[name=dwell]\").val(v.dwell);\n");
      out.write("\t\tc.find(\"input[name=channel]\").val(v.channel);\n");
      out.write("\t\tif (!_isnull(v.type) && !_isnull(v.subtype)) {\n");
      out.write("\t\t\tvar frame = v.type+\"\"+parseInt(v.subtype).toString(16);\n");
      out.write("\t\t\tc.find(\"select[name=frame]\").val(frame).change();\n");
      out.write("\t\t}\n");
      out.write("\t\tif (!_isnull(v.fromds) && !_isnull(v.tods)) {\n");
      out.write("\t\t\tvar ds = v.fromds+\"\"+v.tods;\n");
      out.write("\t\t\tc.find(\"select[name=ds]\").val(ds).change();\n");
      out.write("\t\t}\n");
      out.write("\t\tvar addrtype = \"\";\n");
      out.write("\t\tswitch (_int(v.addrCount)) {\n");
      out.write("\t\tcase 1:\n");
      out.write("\t\t\tc.find(\"input[name=addr1_da]\").val(v.da);\n");
      out.write("\t\t\taddrtype = \"addr1\";\n");
      out.write("\t\t\tbreak;\n");
      out.write("\t\tcase 2:\n");
      out.write("\t\t\tc.find(\"input[name=addr2_da]\").val(v.da);\n");
      out.write("\t\t\tc.find(\"input[name=addr2_sa]\").val(v.sa);\n");
      out.write("\t\t\taddrtype = \"addr2\";\n");
      out.write("\t\t\tbreak;\n");
      out.write("\t\tcase 3:\n");
      out.write("\t\t\tc.find(\"input[name=addr3_bssid]\").val(v.bssid);\n");
      out.write("\t\t\tc.find(\"input[name=addr3_da]\").val(v.da);\n");
      out.write("\t\t\tc.find(\"input[name=addr3_sa]\").val(v.sa);\n");
      out.write("\t\t\taddrtype = \"addr3\";\n");
      out.write("\t\t\tbreak;\n");
      out.write("\t\tcase 4:\n");
      out.write("\t\t\tc.find(\"input[name=addr4_ra]\").val(v.ra);\n");
      out.write("\t\t\tc.find(\"input[name=addr4_ta]\").val(v.ta);\n");
      out.write("\t\t\tc.find(\"input[name=addr4_da]\").val(v.da);\n");
      out.write("\t\t\tc.find(\"input[name=addr4_sa]\").val(v.sa);\n");
      out.write("\t\t\taddrtype = \"addr4\";\n");
      out.write("\t\t\tbreak;\n");
      out.write("\t\tdefault:\n");
      out.write("\t\t\tif (!_isnull(v.anyAddr)) {\n");
      out.write("\t\t\t\tc.find(\"input[name=any_addr]\").val(v.anyAddr);\n");
      out.write("\t\t\t\taddrtype = \"any_addr\";\t\n");
      out.write("\t\t\t}\n");
      out.write("\t\t\tif (!_isnull(v.ap)) {\n");
      out.write("\t\t\t\tc.find(\"input[name=ap]\").val(v.ap);\n");
      out.write("\t\t\t\taddrtype = \"apsta\";\n");
      out.write("\t\t\t}\n");
      out.write("\t\t\tif (!_isnull(v.sta)) {\n");
      out.write("\t\t\t\tc.find(\"input[name=sta]\").val(v.sta);\n");
      out.write("\t\t\t\taddrtype = \"apsta\";\n");
      out.write("\t\t\t}\n");
      out.write("\t\t}\n");
      out.write("\t\tc.find(\"select[name=address]\").val(addrtype).change();\n");
      out.write("\t\t\n");
      out.write("\t\tvar tag_div = c.find(\".tag_div\");\n");
      out.write("\t\ttag_div.empty();\n");
      out.write("\t\tc.find(\"input[name=tags]\").val(\"0\");\n");
      out.write("\t\tif (!_isnull(v.taglist)) {\n");
      out.write("\t\t\tc.find(\"input[name=tags]\").val(v.taglist.length);\n");
      out.write("\t\t\t$.each(v.taglist, function(k, t) {\n");
      out.write("\t\t\t\tvar ct = $(\"#sample_tag\").clone(true);\n");
      out.write("\t\t\t\tct.removeClass(\"hidden\");\n");
      out.write("\t\t\t\tct.find(\"input\").val(\"\");\n");
